// import React from "./react";
import Logo from '../common/Logo/Logo';
import "./Header.css";
import ScrollToButton from "../common/ScrollToButton.js";

function Header_not_loggedin(props) {
    return (
        <header>
            <div id="header-div">
                <Logo width="110"/>
                <div class="nav-block">
                    <ScrollToButton toId="tab-1">Особенности</ScrollToButton>
                    <ScrollToButton toId="tab-2">Популярные пользователи</ScrollToButton>
                    <ScrollToButton toId="tab-3">Про нас</ScrollToButton>
                </div>
                <div class="reg-signin-block">
                    <a href='yandex.ru' style={{color: "#000"}}>Login</a>
                    <h>/</h>
                    <a href="yandex.ru" style={{color: "#000"}}>Sign up</a>
                </div>
            </div>
        </header>
    )
}

export default Header_not_loggedin;
